import React, { Component } from 'react';

import Navigation from "./Navigation";
import LearnPage from './LearnPage';
import UnderstandPage from './UnderstanPage';
import ReviewPage from './ReviewPage';

export default class LandingPage extends Component {
  constructor () {
    super ();
    this.state= {
      questReview: []
    }
  }
  render () {
    return(
      <div className="layout">
        <header>
          <Navigation />
        </header>
        <section className="landingBody">
          <article className="mission">
            <h2 className="mission__title">Array Proto Training</h2>
            <p className="mission__content">
              As a blooming developer, it is critical to learn, understand, and retain 
            </p>
          </article>
          <nav className="LandingNav">
            <button className="landing__btn learn">Learn</button>
            <button className="landing__btn quiz">Quiz</button>
            <button className="landing__btn review">Review</button>
          </nav>
        </section>
      </div>
    )
  }
}
